import svgImage from '../public/media/svgBackground.svg';
import Mockps from '../public/media/mockups.svg';

const Header = () => {
    return (
        <header class="w-100 svg-image-header">
            <img src={svgImage}/>
            <div class="container">
                <div className="row">
                    <div className={'col-6'}>
                        <img src={Mockps}/>
                    </div>
                    <div className={"col-6"}>
                        p test
                    </div>
                </div>
            </div>
        </header>
    )
}


export default Header;
